import React, { Fragment } from 'react';
import { Fab } from "@material-ui/core";
import AddIcon from '@material-ui/icons/Add';

const QueryList = props => {
  return (
    <Fragment>
      <Fab color="primary" aria-label="add">
        <AddIcon />
      </Fab>
    </Fragment>
  );
}

export default QueryList;
